import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Main  from './components/Main';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/main" element={<Main/>} exact/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
